  [],\n\t\"num_tags\": 0,\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-casts-aboard-rude-as-part-of-project-opr-e350-ru-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130301 includes physical
  and profile data collected aboard NOAA Ship RUDE during project OPR-E350-RU-06 in
  the North Atlantic Ocean from 2005-09-13 to 2007-09-13. These data include SOUND
